import React from "react";

class VideoModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state.module);
    return (
      <div
        className="uk-width-1-1@s uk-width-2-3@m uk-row-first uk-margin-large-bottom uk-align-center "
        uk-scrollspy="cls:uk-animation-fade; delay: 500"
      >
        >
        <iframe
          src={this.state.module.src}
          width="1920"
          height="1080"
          frameBorder="0"
          allowFullScreen={true}
          uk-responsive="true"
          uk-video="automute: true; autoplay: true"
          className="uk-responsive-width"
        />
        <hr />
      </div>
    );
  }
}

export default VideoModule;
